INSERT INTO `faqs` (`faq_id`, `question`, `answer`, `create_by`, `created_at`, `updated_at`, `delete_date`, `delete_yn`, `order_by`) VALUES
(1, 'dsafasdfas2222222', 'fdasfdasfdasdf2222222', 1, '2023-12-19 00:19:13', '2023-12-19 00:27:04', '2023-12-19 00:56:33', 1, 0),
(2, 'What information should I include in my event invitation?', 'Include essential details like the event name, date, time, venue, and a brief description. Additionally, mention any special instructions, dress code, or RSVP information.', 1, '2023-12-19 00:36:41', NULL, NULL, 0, 1),
(3, 'What is a virtual event, and how do I host one?', 'A virtual event takes place online, connecting participants through webinars, video conferencing, or live streaming. To host one, use virtual event platforms that support interactive features and engagement.', 1, '2023-12-19 00:37:00', NULL, NULL, 0, 2),
(4, 'How do I choose the right venue for my event?', 'Consider factors such as the number of attendees, location accessibility, amenities, and the ambiance that aligns with your event theme. Schedule a site visit to assess the venue in person.', 1, '2023-12-19 00:37:18', NULL, NULL, 0, 3),
(5, 'What is event sponsorship, and how can I attract sponsors?', 'Event sponsorship involves partnering with businesses or individuals who provide financial support in exchange for brand exposure. Create attractive sponsorship packages and reach out to potential sponsors with a compelling proposal.', 1, '2023-12-19 00:37:32', NULL, NULL, 0, 4),
(6, 'What should I do in case of bad weather for an outdoor event?', 'Have a backup plan for indoor accommodation or consider renting tents. Keep attendees informed about weather updates and contingency measures.', 1, '2023-12-19 00:37:49', NULL, NULL, 0, 6),
(7, 'How do I create a successful event agenda?', 'Plan your agenda with a balance of engaging activities, speakers, and breaks. Ensure that the schedule aligns with the goals of your event and provides value to attendees.', 1, '2023-12-19 00:38:03', NULL, NULL, 0, 5);
